import React from 'react'
import styled from 'styled-components'

import { THEME } from '../../../../theme'
import { AppRouterLink } from '../../../UI/AppRouterLink'


const LeftMenuStyles = styled.div`
  background-color: ${ THEME.BACKGROUND_COLOR };
`

const RightMenuStyles = styled.div`

`


export const HeaderMainNav = props => {
  const leftMenuLinksData = [
    { name: 'Лекарственные и профилактические средства', href: '#????', IconComponent: '' },
    { name: 'Медицинская техника и изделия', href: '#????', IconComponent: '' },
    { name: 'Нетоварные позиции', href: '#????', IconComponent: '' },
    { name: 'Оптика', href: '#????', IconComponent: '' },
    { name: 'Продукты питания', href: '#????', IconComponent: '' },
    { name: 'Средства для красоты и гигиены', href: '#????', IconComponent: '' },
    { name: 'Товары для дома и сопутствующие', href: '#????', IconComponent: '' },
    { name: 'Товары для матери и ребенка', href: '#????', IconComponent: '' },
  ]


  const leftMenuLinks = leftMenuLinksData.map(({ name, href, IconComponent }, id) => (
    <AppRouterLink href={ href }>
      { IconComponent }
      { name }
    </AppRouterLink>
  ));


  return (
    <div className="container-fluid">
      <div className="row">
        <LeftMenuStyles className="col-3 direction-column">
          { leftMenuLinks }
        </LeftMenuStyles>
        <RightMenuStyles className="col-9">

        </RightMenuStyles>
      </div>
    </div>
  )
}
